Type-safe handler tied to a route's computed types.

Usage:
  myHandler :: Handler (id :: Int) (limit :: Maybe Int) (authorization :: BearerToken) User
    (ok :: ResponseData () (Array Post), notFound :: ResponseData () ErrorMessage)
  myHandler { path, query, headers, body } = do
    -- path :: { id :: Int }
    -- query :: { limit :: Maybe Int }
    -- headers :: { authorization :: BearerToken }
    -- body :: User
    pure $ respondNoHeaders (Proxy :: _ "ok") []

Build a complete OpenAPI 3.0 spec from a type-level collection of routes.

Examples:
  -- Basic usage:
  buildOpenAPISpec @(HealthRoute /\ UserRoute)
    { title: "My API", version: "1.0.0" }

  -- With servers:
  buildOpenAPISpec' @(HealthRoute /\ UserRoute)
    { title: "My API"
    , version: "1.0.0"
    , servers: Just
        [ { url: "https://api.example.com", description: Just "Production server" }
        , { url: "https://staging-api.example.com", description: Just "Staging server" }
        ]
    }

